import React from "react";
import { useNavigate } from "react-router-dom";
import { 
  ChevronRight, 
  FileText, 
  Stethoscope, 
  Heart, 
  Calendar 
} from "lucide-react";

const Patients = () => {
  const navigate = useNavigate();
  const patients = [
    {
      id: "P001",
      name: "John Doe",
      age: 45,
      lastVisit: "2024-04-10",
      riskLevel: "Low",
      nextCheckup: "2024-05-10"
    },
    {
      id: "P002",
      name: "Jane Smith",
      age: 32,
      lastVisit: "2024-04-09",
      riskLevel: "High",
      nextCheckup: "2024-04-20"
    }
  ];

  const ActionButton = ({ icon: Icon, label, onClick }) => (
    <button
      onClick={(e) => {
        e.stopPropagation();
        onClick();
      }}
      className="inline-flex items-center px-3 py-1.5 text-sm font-medium text-blue-600 hover:text-blue-700 
        transition-colors rounded-md hover:bg-blue-50"
    >
      <Icon className="w-4 h-4 mr-1" />
      {label}
    </button>
  );

  return (
    <div className="bg-white rounded-lg shadow">
      <div className="px-6 py-4 border-b border-gray-200">
        <h2 className="text-xl font-semibold text-gray-800">Patients</h2>
      </div>
      <div className="overflow-x-auto">
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                ID
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Name
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Age
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Last Visit
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Risk Level
              </th>
              <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Actions
              </th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            {patients.map((patient) => (
              <tr
                key={patient.id}
                className="hover:bg-gray-50"
              >
                <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">
                  {patient.id}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                  {patient.name}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                  {patient.age}
                </td>
                <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                  {patient.lastVisit}
                </td>
                <td className="px-6 py-4 whitespace-nowrap">
                  <span
                    className={`px-2 py-1 text-xs font-medium rounded-full ${
                      patient.riskLevel === "High"
                        ? "bg-red-100 text-red-800"
                        : "bg-green-100 text-green-800"
                    }`}
                  >
                    {patient.riskLevel}
                  </span>
                </td>
                <td className="px-6 py-4 whitespace-nowrap space-x-2">
                  <ActionButton
                    icon={FileText}
                    label="Risk Report"
                    onClick={() => navigate(`/patients/${patient.id}/risk-report`)}
                  />
                  <ActionButton
                    icon={Stethoscope}
                    label="Drug Interactions"
                    onClick={() => navigate(`/patients/${patient.id}/drug-interactions`)}
                  />
                  <ActionButton
                    icon={Heart}
                    label="Wellness Plan"
                    onClick={() => navigate(`/patients/${patient.id}/wellness-plan`)}
                  />
                  <ActionButton
                    icon={Calendar}
                    label="Check-up"
                    onClick={() => navigate(`/patients/${patient.id}/checkup`)}
                  />
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Patients;
